import React from 'react';
import Histogram from 'react-chart-histogram';

function GraphLine() {      


    const labels = ['A','b','c'];
    const data = [200, 300, 100, 400];
    const options = { fillColor: '#8D8DC5', strokeColor: '#FFFFFF'};
    const width = '720';
    const height= '400';

    return (
    <div >
      <Histogram
        xLabels={labels}
        yValues={data}
        options={options}
        width={width}
        height={height}
      />
    </div>
